import FoodsListBox from './FoodsListBox';
import CartPageBox from './CartPageBox';

import { Box, Center } from '@chakra-ui/react';

export default function ContainerBox() {

  return (
    <>
    <Center>
      <Box borderRadius='md'
      w="375px"
      h="667px"
      marginTop="40px"
      overflow="scroll"
      letterSpacing='wide'
      bg="gray.200"
      boxShadow="base">
        <FoodsListBox />
        <CartPageBox />
      </Box>
    </Center>
    </>
  )
}
